import styles from './layout.module.css';

//<link href='https://fonts.googleapis.com/css?family=Comfortaa' rel='stylesheet'/>
function Layout ({ children }) {
    return 
    <div className={styles.container}>
        {children}
    </div>
}

export default Layout;
